import React, { useState } from 'react';
import { Upload, RotateCcw } from 'lucide-react';

const OCTClassifier = () => {
  const [image, setImage] = useState(null);
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [opacity, setOpacity] = useState(0.7);

  const handleImageUpload = async (event) => {
    const file = event.target.files[0];
    if (!file) return;

    setLoading(true);
    const formData = new FormData();
    formData.append('file', file);
    formData.append('model', 'mobilenet_v3');

    try {
      const response = await fetch('http://localhost:5000/api/classify', {
        method: 'POST',
        body: formData,
      });
      
      const data = await response.json();
      setResults(data);
      setImage(URL.createObjectURL(file));
    } catch (error) {
      console.error('Error classifying image:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleReset = () => {
    setImage(null);
    setResults(null);
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white p-8">
      <div className="max-w-6xl mx-auto space-y-8">
        {/* Upload Area */}
        <div className={`border-2 border-dashed border-blue-400 rounded-lg p-8 
          ${!image ? 'bg-gray-800/50' : 'bg-transparent'}`}>
          {!image ? (
            <div className="flex flex-col items-center justify-center">
              <Upload className="w-12 h-12 text-blue-400 mb-4" />
              <label htmlFor="image-upload" className="cursor-pointer">
                <span className="text-blue-400 text-xl">Click or drag image to upload</span>
                <input
                  id="image-upload"
                  type="file"
                  className="hidden"
                  accept="image/*"
                  onChange={handleImageUpload}
                />
              </label>
            </div>
          ) : (
            <div className="flex justify-between items-start">
              <div className="w-1/2">
                <h2 className="text-xl text-blue-400 mb-4">Original Image</h2>
                <img 
                  src={image} 
                  alt="Original" 
                  className="rounded-lg w-full"
                />
              </div>
              
              <div className="w-1/2 pl-8">
                <div className="bg-gray-800 rounded-lg p-6 mb-6">
                  <h2 className="text-xl text-blue-400 mb-4">Results</h2>
                  {results && (
                    <>
                      <p className="mb-2">Condition: {results.class}</p>
                      <p>Confidence: {results.confidence.toFixed(1)}%</p>
                    </>
                  )}
                </div>

                <div className="bg-gray-800 rounded-lg p-6">
                  <h2 className="text-xl text-blue-400 mb-4">Grad-CAM Visualization</h2>
                  {results && (
                    <div className="relative">
                      <img 
                        src={image}
                        alt="Base"
                        className="rounded-lg w-full"
                      />
                      <img 
                        src={`data:image/png;base64,${results.gradcam}`}
                        alt="Heatmap"
                        className="absolute top-0 left-0 w-full h-full rounded-lg mix-blend-multiply"
                        style={{ opacity }}
                      />
                      {/* Opacity Control */}
                      <div className="mt-4">
                        <label className="block text-sm mb-2">Heatmap Intensity</label>
                        <input
                          type="range"
                          min="0"
                          max="1"
                          step="0.1"
                          value={opacity}
                          onChange={(e) => setOpacity(e.target.value)}
                          className="w-full"
                        />
                      </div>
                    </div>
                  )}
                </div>
              </div>
            </div>
          )}
        </div>

        {/* Reset Button */}
        {image && (
          <div className="flex justify-center">
            <button
              onClick={handleReset}
              className="flex items-center gap-2 bg-blue-600 hover:bg-blue-700 text-white px-6 py-2 rounded-lg transition-colors"
            >
              <RotateCcw className="w-5 h-5" />
              Reset
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default OCTClassifier;
